        <script type="text/javascript">
            function getPDFFileButton () {
                // Select which div with id that need to be printed
                // to print body $('body')
                // here printing div with content id $("#content")
                // using html canvas to save as required pdf to image to preserve css
 
                return html2canvas($('#result-area'), {
                    
                    onrendered: function(canvas) {

                        var wid;
                        var hgt;

                        if(navigator.userAgent.indexOf("Chrome") != -1 )
                        {   
                            var img = canvas.toDataURL("image/octet-stream,1.0", wid = canvas.width, hgt = canvas.height);

                            /*var a = document.createElement('a');
                            a.href = canvas.toDataURL("image/octet-stream,1.0");
                            a.download = 'Recruiter.jpg';
                            a.click();*/
                        } else if(navigator.userAgent.indexOf("Safari") != -1){ 
                            var img = canvas.toDataURL("image/octet-stream,1.0", wid = canvas.width, hgt = canvas.height);

                            /*var a = document.createElement('a');
                            a.href = canvas.toDataURL("image/octet-stream,1.0");
                            a.download = 'Recruiter.jpg';
                            a.click();*/
                        }
                        else{
                            var img = canvas.toDataURL("image/jpeg,1.0", wid = canvas.width, hgt = canvas.height);

                            var dataURL = canvas.toDataURL("image/jpeg,1.0");
                            //window.open(dataURL);
                        }                        
                        
                        var doc = new jsPDF('p', 'mm', [canvas.width, canvas.height]);
                        doc.addImage(img, 'jpeg', 0, 0, canvas.width, canvas.height);
                        doc.save('Recruiter.pdf');
                       /* var doc = new jsPDF('p', 'mm', [canvas.width, canvas.height]);
                        doc.addHTML(document.body,function() {
                            doc.save('html.pdf');
                        });*/
                        //window.open(dataURL, "_newtab" );
                        //window.open(dataURL);
                        //dataURL.output('download_report.png','D');
                        /*a.href = dataURL;
                        a.download = 'download_report.jpg';
                        a.click();*/
                        $("#loader_c_p1").fadeOut(200, "easeInOutExpo");
                        $("#btnPrint").css('display','block');
                    }
                });
            }       
            $("#btnPrint").on("click", function () {
                $("#btnPrint").css('display','none');
                $("#loader_c_p1").fadeIn(200, "easeInOutExpo");
                getPDFFileButton();
            });
        </script>

