<script type="text/javascript">

        var URL_BASE = $('#URL_BASE').val();
        $(".tuid_count").keyup(function(event) {
            if (event.keyCode == 13)
            {
                $('.start-analysis-count').click();
            }
        });
        $('.start-analysis-count').click(function(){
            var tuid = $('#tuid').val();
            var uname = $('#SESSION_UNAME').val();
            var pwd = $('#SESSION_PWD').val();
            if(tuid != '')
            {
                $.ajax({
                    url: URL_BASE + "ajax_function.php",
                    type: "post",
                    data: {"action":"user_count","uname":uname,"pwd":pwd},
                    success: function (response) {
                       //alert(response);
                    },
                    error: function(jqXHR, textStatus, errorThrown) {
                       console.log(textStatus, errorThrown);
                    }
                });
            }
        });

</script>
<script type="text/javascript">
            var ctrlKeyDown = false;
            
               $(document).ready(function(){    
                   $(document).on("keydown", keydown);
                   $(document).on("keyup", keyup);
                    

                function keydown(e) {

                   if ((e.which || e.keyCode) == 116 || ((e.which || e.keyCode) == 82 && ctrlKeyDown)) {
                       // Pressing F5 or Ctrl+R
                       var url = window.location.href;
                       var res = url.replace("http://", "");
                       var split_url = res.split('/')
                        if(split_url[3] != '')
                        {   
                            var URL_BASE = $('#URL_BASE').val();
                            var tuid = $('#tuid').val();
                            var uname = $('#SESSION_UNAME').val();
                            var pwd = $('#SESSION_PWD').val();
                            
                            $.ajax({
                                url: URL_BASE + "ajax_function.php",
                                type: "post",
                                data: {"action":"user_count_decreese","uname":uname,"pwd":pwd},
                                success: function (response) {
                                   //alert(response);
                                },
                                error: function(jqXHR, textStatus, errorThrown) {
                                   console.log(textStatus, errorThrown);
                                }
                            });
                            $('#start-analysis').click();
                        }
                        else
                            location.href = 'http://ec2-13-229-104-76.ap-southeast-1.compute.amazonaws.com/thebactrak/';
                       e.preventDefault();
                   } else if ((e.which || e.keyCode) == 17) {
                       // Pressing  only Ctrl
                       ctrlKeyDown = true;
                   }
               };

               function keyup(e){
                   // Key up Ctrl
                   if ((e.which || e.keyCode) == 17)
                       ctrlKeyDown = false;
               };
           });
        </script>
